import React, { Component } from 'react';
import logo from './logo.svg';
import { BECIData as BECI } from './data/BECI';
import ChartHighstock from './ChartHighstock';
import * as _ from 'lodash';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      selected: 4,
      data: _.cloneDeep(BECI),
      title: 'Google Stock in Highchart',
      type: 'highchart'
    };
  }
  render() {
    let content;
    content = <ChartHighstock data={this.state.data} title={this.state.title} />;

    return (
      <div className="App">
        <div className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <h2>Bitcoin Energy Consumption Index</h2>
        </div>
        <div className="container">

          {content}

        </div>
      </div>
    );
  }
}

export default App;
